import{b as p}from"./route-block.b5bad31b.js";import{o as t,e,a3 as c}from"./main.3d108a59.js";const s={class:"article"},r=c("<p>\u042D\u0442\u043E \u0443\u0436\u0435 \u0432\u043E\u0441\u044C\u043C\u0430\u044F \u043C\u0430\u0448\u0438\u043D\u0430, \u043A\u043E\u0442\u043E\u0440\u0430\u044F \u043E\u0442\u043F\u0440\u0430\u0432\u0438\u043B\u0430\u0441\u044C \u0432 \u0423\u043A\u0440\u0430\u0438\u043D\u0443 \u0441 \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u043C\u043E\u0449\u044C\u044E \u043E\u0442 \u043A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0446\u0435\u0432 \u2013 \u043D\u0430 \u044D\u0442\u043E\u0442 \u0440\u0430\u0437 \u0441\u043E\u0431\u0440\u0430\u043D\u043E 20 \u0442\u043E\u043D\u043D \u043F\u043E\u043C\u043E\u0449\u0438, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u043D\u0430\u0437\u0435\u043C\u043D\u044B\u043C \u043F\u0443\u0442\u0435\u043C \u0434\u043E\u0441\u0442\u0430\u0432\u0438\u0442 \u0444\u0443\u0440\u0430.</p><blockquote><p>\xAB\u0412\u0441\u0435 \u044D\u0442\u043E \u2013 \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0430 \u043B\u0438\u0447\u043D\u043E\u0439 \u0433\u0438\u0433\u0438\u0435\u043D\u044B \u0438 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u044B \u043F\u0438\u0442\u0430\u043D\u0438\u044F, \u0441\u0440\u0435\u0434\u0438 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u043A\u043E\u043D\u0441\u0435\u0440\u0432\u044B, \u043C\u0430\u043A\u0430\u0440\u043E\u043D\u044B, \u0441\u0433\u0443\u0449\u0435\u043D\u043A\u0430, \u0441\u0443\u0445\u043E\u0444\u0440\u0443\u043A\u0442\u044B. \u0413\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u0443\u044E \u043F\u043E\u043C\u043E\u0449\u044C \u043F\u0440\u0438\u043D\u043E\u0441\u044F\u0442 \u043E\u0431\u044B\u0447\u043D\u044B\u0435 \u0436\u0438\u0442\u0435\u043B\u0438 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0430. \u041A\u0440\u043E\u043C\u0435 \u0442\u043E\u0433\u043E, \u0447\u0430\u0441\u0442\u044C \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u043E\u0432 \u044D\u0442\u043E\u0433\u043E \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0433\u043E \u0433\u0440\u0443\u0437\u0430 \u043D\u0430\u043C \u043F\u043E\u043C\u043E\u0433 \u0441\u043E\u0431\u0440\u0430\u0442\u044C \u0431\u043B\u0430\u0433\u043E\u0442\u0432\u043E\u0440\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0439 \u0444\u043E\u043D\u0434 \xAB\u041F\u043E\u0437\u0438\u0442\u0438\u0432 Y\u043Ci\u0442\xBB</p><p>\u0428\u0442\u0430\u0431 \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438</p></blockquote><p>\u0423\u0447\u0438\u0442\u044B\u0432\u0430\u044F \u044D\u0442\u0443 \u043E\u0442\u043F\u0440\u0430\u0432\u043A\u0443 \u0433\u0440\u0443\u0437\u0430, \u0432\u0441\u0435\u0433\u043E \u043A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0446\u0430\u043C\u0438 \u0441\u043E\u0431\u0440\u0430\u043D\u043E \u0438 \u043E\u0442\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u043E \u0443\u0436\u0435 \u043F\u043E\u0447\u0442\u0438 200 \u0442\u043E\u043D\u043D \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u043C\u043E\u0449\u0438 \u0432 \u0423\u043A\u0440\u0430\u0438\u043D\u0443.</p><blockquote><p>\xAB\u0418\u0437 \u0432\u043E\u0441\u044C\u043C\u0438 \u0444\u0443\u0440 \u043F\u044F\u0442\u044C \u0443\u0436\u0435 \u043F\u0440\u0438\u0431\u044B\u043B\u0438 \u0432 \u0423\u043A\u0440\u0430\u0438\u043D\u0443, \u0438 \u0433\u0443\u043C\u043F\u043E\u043C\u043E\u0449\u044C \u0440\u0430\u0441\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u0430 \u043F\u043E \u043D\u0443\u0436\u0434\u0430\u044E\u0449\u0438\u043C\u0441\u044F \u0440\u0435\u0433\u0438\u043E\u043D\u0430\u043C, \u0434\u0432\u0435 \u0444\u0443\u0440\u044B - \u0435\u0449\u0435 \u0432 \u0434\u043E\u0440\u043E\u0433\u0435, \u0438, \u043D\u0430\u043A\u043E\u043D\u0435\u0446, \u0432\u043E\u0441\u044C\u043C\u0443\u044E \u043E\u0442\u043F\u0440\u0430\u0432\u0438\u043B\u0438 \u0441\u0435\u0433\u043E\u0434\u043D\u044F. \u041C\u044B \u043F\u0440\u0438\u0437\u044B\u0432\u0430\u0435\u043C \u043A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0446\u0435\u0432 \u043F\u0440\u0438\u043D\u043E\u0441\u0438\u0442\u044C \u043F\u043E\u043C\u043E\u0449\u044C \u0432 \u043B\u044E\u0431\u043E\u0435 \u0432\u0440\u0435\u043C\u044F. \u041D\u0430\u043C \u0432\u0430\u0436\u043D\u0430 \u043B\u044E\u0431\u0430\u044F \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0430. \u041D\u0430\u043C \u043F\u043E\u043C\u043E\u0433\u0430\u0435\u0442 \u0432\u0435\u0441\u044C \u043C\u0438\u0440, \u0432 \u0442\u043E\u043C \u0447\u0438\u0441\u043B\u0435 \u0438 \u043A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0446\u044B\xBB.</p><p>\u041F\u0435\u0442\u0440 \u0412\u0440\u0443\u0431\u043B\u0435\u0432\u0441\u043A\u0438\u0439, \u043F\u043E\u0441\u043E\u043B \u0423\u043A\u0440\u0430\u0438\u043D\u044B \u0432 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0435</p></blockquote><p>\u0422\u0430\u043A\u0436\u0435 \u0440\u0430\u043D\u0435\u0435 \u0432 \u0423\u043A\u0440\u0430\u0438\u043D\u0443 \u0443\u0436\u0435 \u0432\u044B\u043B\u0435\u0442\u0430\u043B\u0438 8 \u0430\u0432\u0438\u0430\u0440\u0435\u0439\u0441\u043E\u0432 \u0441 \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u043C\u043E\u0449\u044C\u044E \u043E\u0442 \u043D\u0430\u0440\u043E\u0434\u0430 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0430 \u0438 3 \u0440\u0435\u0439\u0441\u0430 - \u043E\u0442 \u043F\u0440\u0430\u0432\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0430 \u0420\u041A.</p><blockquote><p>\xAB200 \u0442\u043E\u043D\u043D \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0433\u043E \u0433\u0440\u0443\u0437\u0430 \u0437\u0430 \u0434\u0432\u0430 \u043C\u0435\u0441\u044F\u0446\u0430 \u0432\u043E\u0439\u043D\u044B \u2013 \u044D\u0442\u043E \u043E\u0447\u0435\u043D\u044C \u043C\u043D\u043E\u0433\u043E. \u0412 \u043E\u0441\u043D\u043E\u0432\u043D\u043E\u043C, \u044D\u0442\u043E \u0432\u0441\u0435 \u0441\u043E\u0431\u0440\u0430\u043D\u043E \u0438\u0437 \u043D\u0435\u0431\u043E\u043B\u044C\u0448\u0438\u0445 \u043F\u0430\u0440\u0442\u0438\u0439 \u0442\u043E\u0432\u0430\u0440\u043E\u0432, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u043A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0446\u044B \u043F\u0440\u0438\u043D\u043E\u0441\u044F\u0442 \u043A\u0430\u0436\u0434\u044B\u0439 \u0434\u0435\u043D\u044C, \u0434\u0435\u043B\u0430\u044F \u0437\u0430\u043A\u0443\u043F\u043A\u0438 \u0432 \u043C\u0430\u0433\u0430\u0437\u0438\u043D\u0430\u0445. \u0411\u0435\u0437 \u044D\u0442\u043E\u0433\u043E \u043C\u044B, \u0443\u043A\u0440\u0430\u0438\u043D\u0446\u044B, \u043F\u0440\u043E\u0441\u0442\u043E \u043D\u0435 \u0432\u044B\u0436\u0438\u043B\u0438 \u0431\u044B\xBB</p><p>\u041E\u043A\u0441\u0430\u043D\u0430 \u0412\u0440\u0443\u0431\u043B\u0435\u0432\u0441\u043A\u0430\u044F, \u0441\u0443\u043F\u0440\u0443\u0433\u0430 \u043F\u043E\u0441\u043B\u0430 \u0423\u043A\u0440\u0430\u0438\u043D\u044B \u0432 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0435</p></blockquote><p>\u0424\u0443\u0440\u044B \u0441 \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u043C\u043E\u0449\u044C\u044E \u0435\u0434\u0443\u0442 \u0447\u0435\u0440\u0435\u0437 \u0442\u0435\u0440\u0440\u0438\u0442\u043E\u0440\u0438\u044E \u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043D\u0430, \u0411\u043E\u043B\u0433\u0430\u0440\u0438\u0438, \u0422\u0443\u0440\u0446\u0438\u0438 \u0438 \u0420\u0443\u043C\u044B\u043D\u0438\u0438. \u0414\u043E\u0440\u043E\u0433\u0430 \u0437\u0430\u043D\u0438\u043C\u0430\u0435\u0442 \u043F\u0440\u0438\u0431\u043B\u0438\u0437\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u0434\u0432\u0435 \u043D\u0435\u0434\u0435\u043B\u0438. \u041D\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043E\u0440\u0438\u0438 \u0423\u043A\u0440\u0430\u0438\u043D\u044B \u0444\u0443\u0440\u044B \u043F\u0440\u0438\u0432\u043E\u0437\u044F\u0442 \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043A\u0443 \u0432 \u043A\u0440\u0443\u043F\u043D\u044B\u0435 \u0445\u0430\u0431\u044B, \u0432 \u0447\u0430\u0441\u0442\u043D\u043E\u0441\u0442\u0438, \u0444\u0443\u0440\u0430, \u043A\u043E\u0442\u043E\u0440\u0430\u044F \u043E\u0442\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0430 \u0441\u0435\u0433\u043E\u0434\u043D\u044F \u043F\u0440\u0438\u0431\u0443\u0434\u0435\u0442 \u0432 \u0412\u0438\u043D\u043D\u0438\u0446\u0443. \u0422\u0443\u0434\u0430 \u043F\u043E\u0441\u0442\u0443\u043F\u0430\u0435\u0442 \u043F\u043E\u043C\u043E\u0449\u044C \u0438\u0437 \u0440\u0430\u0437\u043D\u044B\u0445 \u0441\u0442\u0440\u0430\u043D. \u0422\u0430\u043C \u043E\u043D\u0430 \u0441\u043E\u0440\u0442\u0438\u0440\u0443\u0435\u0442\u0441\u044F \u0438 \u0443\u0436\u0435 \u0440\u0430\u0441\u043F\u0440\u0435\u0434\u0435\u043B\u044F\u0435\u0442\u0441\u044F \u043F\u043E \u0437\u0430\u044F\u0432\u043A\u0430\u043C \u0432 \u043D\u0443\u0436\u0434\u0430\u044E\u0449\u0438\u0435\u0441\u044F \u0440\u0435\u0433\u0438\u043E\u043D\u044B. \u0418 \u043F\u043E\u0442\u0440\u0435\u0431\u043D\u043E\u0441\u0442\u044C \u044D\u0442\u0430 \u0442\u043E\u043B\u044C\u043A\u043E \u0440\u0430\u0441\u0442\u0435\u0442.</p><blockquote><p>\xAB\u041F\u0440\u0438\u043D\u043E\u0441\u0438\u0442\u044C \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u0443\u044E \u043F\u043E\u043C\u043E\u0449\u044C \u043C\u043E\u0436\u043D\u043E - \u0438 \u043D\u0443\u0436\u043D\u043E - \u043A\u0430\u0436\u0434\u044B\u0439 \u0434\u0435\u043D\u044C. \u041F\u0440\u0435\u0434\u043F\u043E\u0447\u0442\u0438\u0442\u0435\u043B\u044C\u043D\u044B \u0441\u0435\u0439\u0447\u0430\u0441 \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0430 \u043B\u0438\u0447\u043D\u043E\u0439 \u0438 \u0434\u0435\u0442\u0441\u043A\u043E\u0439 \u0433\u0438\u0433\u0438\u0435\u043D\u044B, \u043C\u0435\u0434\u0438\u043A\u0430\u043C\u0435\u043D\u0442\u044B, \u043E\u0434\u0435\u0436\u0434\u0430 \u0438 \u043E\u0431\u0443\u0432\u044C \u0438 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u044B \u043F\u0438\u0442\u0430\u043D\u0438\u044F. \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u043D\u0430 \u0434\u0430\u043D\u043D\u044B\u0439 \u043C\u043E\u043C\u0435\u043D\u0442 \u0430\u043A\u0442\u0438\u0432\u043D\u043E \u043F\u0440\u043E\u0432\u043E\u0434\u0438\u043C \u0441\u0431\u043E\u0440 \u0434\u0435\u0442\u0441\u043A\u0438\u0445 \u0432\u0435\u0449\u0435\u0439 \u0434\u043B\u044F \u0434\u0435\u0442\u0441\u043A\u0438\u0445 \u0434\u043E\u043C\u043E\u0432 \u0432 \u0423\u043A\u0440\u0430\u0438\u043D\u0435. \u042D\u0442\u043E \u0431\u0435\u043B\u044C\u0435 \u0434\u043B\u044F \u0434\u0435\u0442\u0435\u0439 2-10 \u043B\u0435\u0442. \u041C\u043E\u0436\u043D\u043E \u043F\u0440\u0438\u043D\u043E\u0441\u0438\u0442\u044C \u0438 \u043A\u043E\u0440\u043C \u0434\u043B\u044F \u0436\u0438\u0432\u043E\u0442\u043D\u044B\u0445 - \u0432 \u0423\u043A\u0440\u0430\u0438\u043D\u0435 \u0441\u0435\u0439\u0447\u0430\u0441 \u043E\u0433\u0440\u043E\u043C\u043D\u043E\u0435 \u043A\u043E\u043B\u0438\u0447\u0435\u0441\u0442\u0432\u043E \u043F\u0440\u0438\u044E\u0442\u043E\u0432 \u0434\u043B\u044F \u0436\u0438\u0432\u043E\u0442\u043D\u044B\u0445 \u043E\u0441\u0442\u0430\u043B\u0438\u0441\u044C \u0431\u0435\u0437 \u0441\u0440\u0435\u0434\u0441\u0442\u0432 \u043A \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E\u0432\u0430\u043D\u0438\u044E\xBB.</p><p>\u0410\u043A\u043D\u0438\u0435\u0442 \u0410\u043C\u0438\u0440\u043A\u0443\u043B\u043E\u0432, \u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440 \u0428\u0442\u0430\u0431\u0430</p></blockquote><p>\u0421\u0435\u0439\u0447\u0430\u0441 \u043F\u0443\u043D\u043A\u0442\u044B \u043F\u0440\u0438\u0435\u043C\u0430 \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u043C\u043E\u0449\u0438 \u0440\u0430\u0431\u043E\u0442\u0430\u044E\u0442 \u0443\u0436\u0435 \u0432 11 \u0440\u0435\u0433\u0438\u043E\u043D\u0430\u0445 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0430: \u0432 \u041A\u0430\u0440\u0430\u0433\u0430\u043D\u0434\u0435, \u0423\u0440\u0430\u043B\u044C\u0441\u043A\u0435, \u0421\u0435\u043C\u0435\u0435, \u0423\u0441\u0442\u044C-\u041A\u0430\u043C\u0435\u043D\u043E\u0433\u043E\u0440\u0441\u043A\u0435, \u0410\u043A\u0442\u0430\u0443, \u0422\u0443\u0440\u043A\u0435\u0441\u0442\u0430\u043D\u0435, \u0410\u0442\u044B\u0440\u0430\u0443, \u042D\u043A\u0438\u0431\u0430\u0441\u0442\u0443\u0437\u0435, \u0410\u043A\u0442\u043E\u0431\u0435, \u0410\u043B\u043C\u0430\u0442\u044B \u0438 \u041D\u0443\u0440-\u0421\u0443\u043B\u0442\u0430\u043D\u0435. \u0410\u0434\u0440\u0435\u0441\u0430 \u043C\u043E\u0436\u043D\u043E \u0443\u0437\u043D\u0430\u0442\u044C \u043F\u043E \u044D\u0442\u043E\u0439 \u0441\u0441\u044B\u043B\u043A\u0435. \u0412 \u0441\u0442\u043E\u043B\u0438\u0446\u0435 \u043F\u0443\u043D\u043A\u0442 \u043F\u0440\u0438\u0435\u043C\u0430 \u0440\u0430\u0431\u043E\u0442\u0430\u0435\u0442 \u043F\u0440\u0438 \u043F\u043E\u0441\u043E\u043B\u044C\u0441\u0442\u0432\u0435 \u0423\u043A\u0440\u0430\u0438\u043D\u044B \u043F\u043E \u0430\u0434\u0440\u0435\u0441\u0443 \u0443\u043B. \u0416\u044B\u043B\u044B\u043E\u0439, 12.</p><p>\u0421\u043F\u0440\u0430\u0432\u043A\u0430 \u043E \u0428\u0442\u0430\u0431\u0435 \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438 \u0423\u043A\u0440\u0430\u0438\u043D\u044B:</p><p>\u0412 \u0428\u0442\u0430\u0431\u0435 \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438 \u0423\u043A\u0440\u0430\u0438\u043D\u044B \u0443\u0436\u0435 \u0440\u0430\u0431\u043E\u0442\u0430\u0435\u0442 \u043E\u043A\u043E\u043B\u043E 670 \u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440\u043E\u0432, 120 \u0438\u0437 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 - \u043D\u0430 \u0441\u0438\u0441\u0442\u0435\u043C\u043D\u043E\u0439 \u043E\u0441\u043D\u043E\u0432\u0435. \u041A\u0440\u043E\u043C\u0435 \u043E\u0441\u043D\u043E\u0432\u043D\u043E\u0439 \u0434\u0435\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u0438 \u2013 \u043F\u0440\u0438\u0435\u043C, \u0441\u043E\u0440\u0442\u0438\u0440\u043E\u0432\u043A\u0430, \u043F\u043E\u0433\u0440\u0443\u0437\u043A\u0430 \u0438 \u043E\u0442\u043F\u0440\u0430\u0432\u043A\u0430 \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043A\u0438, \u0432 \u0428\u0442\u0430\u0431\u0435 \u0442\u0430\u043A\u0436\u0435 \u0440\u0430\u0431\u043E\u0442\u0430\u0435\u0442 \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u043E\u043D\u043D\u0430\u044F \u0441\u043B\u0443\u0436\u0431\u0430, \u0441\u043B\u0443\u0436\u0431\u0430 \u0444\u0430\u043D\u0434\u0440\u0430\u0439\u0437\u0438\u043D\u0433\u0430 \u0438 \u0441\u043B\u0443\u0436\u0431\u0430 \u0438\u0432\u0435\u043D\u0442\u043E\u0432. \u0412\u0441\u0435 \u0440\u0430\u0431\u043E\u0442\u0430\u044E\u0442 \u0438\u0441\u043A\u043B\u044E\u0447\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u043D\u0430 \u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440\u0441\u043A\u0438\u0445 \u043D\u0430\u0447\u0430\u043B\u0430\u0445 \u0440\u0430\u0434\u0438 \u043F\u043E\u043C\u043E\u0449\u0438 \u0443\u043A\u0440\u0430\u0438\u043D\u0446\u0430\u043C \u0432 \u0441\u043B\u043E\u0436\u043D\u043E\u0435 \u0432\u0440\u0435\u043C\u044F.</p><p>\u0412 \u043F\u043B\u0430\u043D\u0430\u0445 \u0428\u0442\u0430\u0431\u0430 \u2013 \u0430\u043A\u0442\u0438\u0432\u043D\u043E\u0435 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u043D\u0430\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u044F \u0431\u043B\u0430\u0433\u043E\u0442\u0432\u043E\u0440\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0445 \u0438\u0432\u0435\u043D\u0442\u043E\u0432, \u0432 \u0447\u0430\u0441\u0442\u043D\u043E\u0441\u0442\u0438 \u0431\u043B\u0430\u0433\u043E\u0442\u0432\u043E\u0440\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0445 \u044F\u0440\u043C\u0430\u0440\u043E\u043A, \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0430 \u043E\u0442 \u043F\u0440\u043E\u0434\u0430\u0436\u0438 \u0438\u0437\u0434\u0435\u043B\u0438\u0439 \u043D\u0430 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u0431\u0443\u0434\u0443\u0442 \u043D\u0430\u043F\u0440\u0430\u0432\u043B\u044F\u0442\u044C\u0441\u044F \u043D\u0430 \u0437\u0430\u043A\u0443\u043F \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u043C\u043E\u0449\u0438 \u0434\u043B\u044F \u0443\u043A\u0440\u0430\u0438\u043D\u0446\u0435\u0432.</p><p>\u0422\u0430\u043A\u0436\u0435 \u0437\u0430\u043F\u0443\u0449\u0435\u043D\u0430 \u0441\u043B\u0443\u0436\u0431\u0430 \u043F\u043E \u0440\u0430\u0431\u043E\u0442\u0435 \u0441 \u0431\u0435\u0436\u0435\u043D\u0446\u0430\u043C\u0438 \u0438\u0437 \u0423\u043A\u0440\u0430\u0438\u043D\u044B. \u041A\u043E\u043C\u0430\u043D\u0434\u0430 \u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440\u043E\u0432 \u043F\u043E\u043C\u043E\u0433\u0430\u0435\u0442 \u0443\u043A\u0440\u0430\u0438\u043D\u0446\u0430\u043C, \u043F\u0440\u0438\u0431\u044B\u0432\u0448\u0438\u043C \u0432 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D \u043F\u043E\u0441\u043B\u0435 \u043D\u0430\u0447\u0430\u043B\u0430 \u0432\u043E\u0439\u043D\u044B, \u0440\u0435\u0448\u0430\u0442\u044C \u0438\u0445 \u0431\u044B\u0442\u043E\u0432\u044B\u0435 \u043F\u0440\u043E\u0431\u043B\u0435\u043C\u044B, \u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0443\u044E \u043F\u043E\u043C\u043E\u0449\u044C, \u0430 \u0442\u0430\u043A\u0436\u0435 \u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u043B\u044E\u0431\u044B\u0435 \u0434\u0440\u0443\u0433\u0438\u0435 \u043A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0446\u0438\u0438 \u043F\u043E \u0430\u0434\u0430\u043F\u0442\u0430\u0446\u0438\u0438 \u0432 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0435. \u0423\u043A\u0440\u0430\u0438\u043D\u0446\u0435\u0432, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u043D\u0443\u0436\u0434\u0430\u044E\u0442\u0441\u044F \u0432 \u043F\u043E\u043C\u043E\u0449\u0438 \u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440\u043E\u0432, \u043F\u0440\u0438\u0437\u044B\u0432\u0430\u0435\u043C \u0441\u043C\u0435\u043B\u043E \u043E\u0431\u0440\u0430\u0449\u0430\u0442\u044C\u0441\u044F \u0432 \u0428\u0442\u0430\u0431.</p>",13),a=[r],l={setup(i,{expose:o}){return o({frontmatter:{title:"\u041F\u043E\u0447\u0442\u0438 200 \u0442\u043E\u043D\u043D \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u043C\u043E\u0449\u0438 \u0423\u043A\u0440\u0430\u0438\u043D\u0435 \u0443\u0436\u0435 \u043E\u0442\u043F\u0440\u0430\u0432\u0438\u043B\u0438 \u0438\u0437 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0430",description:"21 \u0430\u043F\u0440\u0435\u043B\u044F 2022 \u0433\u043E\u0434\u0430 \u0428\u0442\u0430\u0431 \u0433\u0443\u043C\u0430\u043D\u0438\u0442\u0430\u0440\u043D\u043E\u0439 \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0438 \u0423\u043A\u0440\u0430\u0438\u043D\u044B \u0432 \u041A\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043D\u0435 \u043E\u0442\u043F\u0440\u0430\u0432\u0438\u043B \u043E\u0447\u0435\u0440\u0435\u0434\u043D\u043E\u0439 \u0433\u0440\u0443\u0437 \u0438\u0437 \u041D\u0443\u0440-\u0421\u0443\u043B\u0442\u0430\u043D\u0430."}}),(u,_)=>(t(),e("div",s,a))}};typeof p=="function"&&p(l);export{l as default};
